import React, { Component } from 'react'
import Chart from 'react-apexcharts'
import axios from 'axios'

export default class body extends Component {
    constructor() {
        super()

        this.state = {
            series: [{
                data: [
                  [1538856000000, 6593.34, 6600, 6582.63, 6600], 
                  [1538856900000, 6595.16, 6604.76, 6590.73, 6593.86]
                ]
                }]
            }
        }

    componentDidMount(){
        axios.get("https://www.moneycontrol.com/mc/widget/basicchart/get_chart_value?classic=true&sc_did=IOC&dur=max")
        .then((result)=>{
            console.log(result);
        })
    }

    render() {
        return (
            <Chart series={this.state.series} type="candlestick" width={500} height={320} />
        )
    }
}
